import React from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import { dummyProfiles } from '../data/dummyProfiles';
import '../styles/Profile.css';

const ProfileDetail = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  
  const profile = dummyProfiles.find(p => p.id === parseInt(id));

  if (!profile) {
    return (
      <div className="profile-error">
        <p>Profile not found</p>
        <button onClick={() => navigate('/users')}>Back to Users</button>
      </div>
    );
  }

  return (
    <div className="profile-container">
      <div className="profile-banner">
        <img src={profile.bannerImage} alt="Banner" />
      </div>

      <div className="profile-main">
        <div className="profile-photo">
          <img src={profile.image} alt="Profile" />
        </div>

        <div className="profile-info">
          <h2>{profile.name}</h2>
          <p className="profile-role">{profile.positionTitle} at {profile.companyName}</p>
          <p className="profile-bio">{profile.bio}</p>

          <div className="profile-section">
            <h4>Contact</h4>
            <p>Email: {profile.email}</p>
            {profile.twitter && (
              <p>Twitter: <a href={profile.twitter} target="_blank" rel="noreferrer">{profile.twitter}</a></p>
            )}
            {profile.instagram && (
              <p>Instagram: <a href={profile.instagram} target="_blank" rel="noreferrer">{profile.instagram}</a></p>
            )}
          </div>

          <div className="profile-section">
            <h4>About</h4>
            <p>{profile.fullBio}</p>
          </div>

          <div className="profile-section">
            <h4>Experience</h4>
            <p>{profile.experienceSummary}</p>
          </div>

          <div className="profile-section">
            <h4>Skills</h4>
            <div className="skills-container">
              {profile.skills.map((skill, index) => (
                <span key={index} className="skill-tag">{skill}</span>
              ))}
            </div>
          </div>

          <div className="profile-section">
            <h4>Popular Work</h4>
            <p>{profile.popularWork}</p>
            {profile.workLink && (
              <a href={profile.workLink} target="_blank" rel="noreferrer">View Work</a>
            )}
          </div>

          <div className="profile-section">
            <h4>Project</h4>
            <p>{profile.projectDescription}</p>
            {profile.githubLink && (
              <a href={profile.githubLink} target="_blank" rel="noreferrer">GitHub</a>
            )}
          </div>

          <div className="profile-section">
            <h4>Rating</h4>
            <div className="profile-rating">
              {'★'.repeat(Math.floor(profile.rating))}
              {'☆'.repeat(5 - Math.floor(profile.rating))}
              <span className="rating-number">({profile.rating})</span>
            </div>
          </div>

          <button 
            className="btn btn-primary mt-3"
            onClick={() => navigate('/users')}
          >
            Back to Users
          </button>
        </div>
      </div>
    </div>
  );
};

export default ProfileDetail;
